import React, { Component } from 'react'
import Detail from './Detail'
export default class Message extends Component {

  state = {
    messageArr: [
      { id: '001', title: '消息001' },
      { id: '002', title: '消息002' },
      { id: '003', title: '消息003' },
    ]
  }

  render() {
    return (
      <div>
        <ul>
          {
            this.state.messageArr.map((msgObj) => {
              return (
                <li key={msgObj.id}>
                  <a href="/xxxxxxx">{msgObj.title}</a>&nbsp;
                </li>
              )
            })
          }
        </ul>
      </div>
    )
  }
}
